import React from "react";
import {
  Container,
  Card,
  CardActionArea,
  CardMedia,
  Grid,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles(() => ({
  root: {
    width: "64vw",
    height: "120vh",
  },
}));
const Products = () => {
  const Classes = useStyles();
  return (
    <div className="Box">
      <Container className={Classes.root}>
        <h1 className="text-center">Top categories</h1>
        <img src="../images/leave.png" className="rounded" alt="..."></img>
        <Grid container spacing={4}>
          <Grid item sm={3}>
            <Card>
              <CardActionArea>
                <CardMedia
                  className="card"
                  image="../images/organic.png"
                  style={{ height: 250 }}
                />
              </CardActionArea>
            </Card>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default Products;
